import enLocale from 'element-ui/lib/locale/lang/en'
const en = {
  message: {
    'logout': 'Log Out',
    'login_welcome': 'Welcome to Playnovate',
    'username_input': 'Please enter username',
    'password_input': 'Please enter password',
    'fullscreen': 'Fullscreen',
    'login_btn': 'Login',
    'expired_time': 'Expired Time',
    'version': 'version: ',
    'back_btn': 'back'
  },
  errors: {
    'user_expired': 'Your account already expired date',
    'wrong_password': 'You have enter a wrong username or password'
  },
  ...enLocale
}
export default en
